import React, { useEffect, useState } from "react";
import axios from "axios";

const DashboardPage = () => {
  const [parties, setParties] = useState([]);
  const [factories, setFactories] = useState([]);
  const [filters, setFilters] = useState({
    partyId: null,
    factoryId: null,
    startDate: "",
    endDate: "",
  });

  const [summaryData, setSummaryData] = useState({
    transactions: [],
    payments: [],
  });

  // Fetch parties and factories for dropdowns and counts
  useEffect(() => {
    const fetchPartiesAndFactories = async () => {
      const [partyRes, factoryRes] = await Promise.all([
        axios.get("/api/parties"),
        axios.get("/api/factories"),
      ]);
      setParties(partyRes.data);
      setFactories(factoryRes.data);
    };
    fetchPartiesAndFactories();
  }, []);

  // Fetch summary data when party is selected
  useEffect(() => {
    const fetchSummary = async () => {
      if (!filters.partyId) return;

      let query = "";
      if (filters.startDate) query += `from=${filters.startDate}&`;
      if (filters.endDate) query += `to=${filters.endDate}&`;
      if (filters.factoryId) query += `factoryId=${filters.factoryId}`;

      const res = await axios.get(`/api/parties/${filters.partyId}/summary?${query}`);
      setSummaryData(res.data);
    };

    fetchSummary();
  }, [filters]);

  return (
    <div className="p-6">
      {/* Summary Cards */}
      <div className="grid grid-cols-1 sm:grid-cols-2 gap-6 mb-8">
        <div className="bg-white p-4 shadow rounded text-center">
          <h3 className="font-semibold text-gray-600">Total Parties</h3>
          <p className="text-2xl font-bold text-green-600">{parties.length}</p>
        </div>
        <div className="bg-white p-4 shadow rounded text-center">
          <h3 className="font-semibold text-gray-600">Total Factories</h3>
          <p className="text-2xl font-bold text-blue-600">{factories.length}</p>
        </div>
      </div>

      {/* Party and Factory Filters */}
      <div className="flex flex-wrap gap-6 mb-6 items-end">
        <div className="flex flex-col">
          <label className="font-semibold mb-1">Select Party</label>
          <select
            className="border px-3 py-2 rounded"
            value={filters.partyId || ""}
            onChange={(e) =>
              setFilters((prev) => ({
                ...prev,
                partyId: e.target.value ? parseInt(e.target.value) : null,
              }))
            }
          >
            <option value="">-- Select Party --</option>
            {parties.map((p) => (
              <option key={p.id} value={p.id}>{p.name}</option>
            ))}
          </select>
        </div>

        <div className="flex flex-col">
          <label className="font-semibold mb-1">Select Factory</label>
          <select
            className="border px-3 py-2 rounded"
            value={filters.factoryId || ""}
            onChange={(e) =>
              setFilters((prev) => ({
                ...prev,
                factoryId: e.target.value ? parseInt(e.target.value) : null,
              }))
            }
          >
            <option value="">-- Optional Factory --</option>
            {factories.map((f) => (
              <option key={f.id} value={f.id}>{f.name}</option>
            ))}
          </select>
        </div>

        <div className="flex flex-col">
          <label className="font-semibold mb-1">Start Date</label>
          <input
            type="date"
            className="border px-3 py-2 rounded"
            value={filters.startDate}
            onChange={(e) =>
              setFilters((prev) => ({ ...prev, startDate: e.target.value }))
            }
          />
        </div>

        <div className="flex flex-col">
          <label className="font-semibold mb-1">End Date</label>
          <input
            type="date"
            className="border px-3 py-2 rounded"
            value={filters.endDate}
            onChange={(e) =>
              setFilters((prev) => ({ ...prev, endDate: e.target.value }))
            }
          />
        </div>
      </div>

      {/* Transactions Table */}
      {summaryData.transactions?.length > 0 && (
        <div className="mb-10">
          <h3 className="text-lg font-bold mb-2">Transactions</h3>
          <div className="overflow-x-auto">
            <table className="min-w-full border">
              <thead className="bg-gray-100">
                <tr>
                  <th className="border px-4 py-2">#</th>
                  <th className="border px-4 py-2">Date</th>
                  <th className="border px-4 py-2">Factory</th>
                  <th className="border px-4 py-2">Weight</th>
                  <th className="border px-4 py-2">Rate</th>
                  <th className="border px-4 py-2">Deduction</th>
                  <th className="border px-4 py-2">Total</th>
                </tr>
              </thead>
              <tbody>
                {summaryData.transactions.map((tx, index) => (
                  <tr key={index}>
                    <td className="border px-4 py-2">{index + 1}</td>
                    <td className="border px-4 py-2">{tx.date}</td>
                    <td className="border px-4 py-2">{tx.factory_name}</td>
                    <td className="border px-4 py-2">{tx.weight}</td>
                    <td className="border px-4 py-2">{tx.rate}</td>
                    <td className="border px-4 py-2">{tx.deduction}</td>
                    <td className="border px-4 py-2">{tx.total_amount}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}

      {/* Payments Table */}
      {summaryData.payments?.length > 0 && (
        <div>
          <h3 className="text-lg font-bold mb-2">Payments</h3>
          <div className="overflow-x-auto">
            <table className="min-w-full border">
              <thead className="bg-gray-100">
                <tr>
                  <th className="border px-4 py-2">#</th>
                  <th className="border px-4 py-2">Date</th>
                  <th className="border px-4 py-2">Amount</th>
                  <th className="border px-4 py-2">Remaining</th>
                  <th className="border px-4 py-2">Note</th>
                </tr>
              </thead>
              <tbody>
                {summaryData.payments.map((p, index) => (
                  <tr key={index}>
                    <td className="border px-4 py-2">{index + 1}</td>
                    <td className="border px-4 py-2">{p.date}</td>
                    <td className="border px-4 py-2">{p.amount}</td>
                    <td className="border px-4 py-2">{p.remaining_amount}</td>
                    <td className="border px-4 py-2">{p.note || "-"}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default DashboardPage;
